import styled from "styled-components";

export const MyTeamStyle = styled.div`

    background-image: linear-gradient(#D3D3D3, #808080);

    .container {
        margin: 0;
        width: 100vw;
        height: 100vh;
        overflow-x: hidden;
        display: flex;
        padding-left: 500px;
    }

    .jogadores {
        widht: 100px;
        height: 100px;
        background: red;
    }

}

`
